import React from 'react'

class Game extends React.Component {
    constructor(props){
        super(props)
        this.game = this.props.value;
        this.show = "visible";
    }

    render() {
        
        document.getElementById("play").style.display = "none";
        return (
            <div className="col-sm-6">
                <div className="feature-item feature-item-color">
                    <h2>{this.game.game_id}</h2>
                    <h3>{this.game.status}</h3>
                    <p className="text-muted">Guessed: {this.game.guessed}</p>
                    <p className="text-muted">Correct: {this.game.correct}</p>
                    <div id="play"><p>hello {this.show}</p></div>
                </div>
            </div>
        )
    }
}

export default Game
